import {createSlice, PayloadAction} from "@reduxjs/toolkit";
import {defaultSearchResult} from "./defaultState";
import {UserLogged} from "../../users-logged-widget/model/model/types";


const searchSlice = createSlice(
    {
        name: 'searcSlice',
        initialState: defaultSearchResult,
        reducers: {
            searchResultSucces: (state, action: PayloadAction<UserLogged>) => {
                state.name=action.payload.name;
                state.userId=action.payload.userId;
                state.username=action.payload.username;
                state.profilePhoto=action.payload.profilePhoto;
            }

        }
    }
);

export const {searchResultSucces}= searchSlice.actions;

export default searchSlice.reducer;
